	"sap/sf/workflow/returntoworkplace_employee/i18n/i18n_it_IT.properties":'CARD_TITLE=Ritorno all\'ambiente di lavoro (dipendente)\nCARD_SUBTITLE=Garantisci la tua sicurezza prima del ritorno all\'ambiente di lavoro\nCARD_DESCRIPTION=Garantisci la tua sicurezza prima del ritorno all\'ambiente di lavoro.\nCARD_KEYWORD_1=Ritorno all\'ambiente di lavoro\nCARD_KEYWORD_2=Workflow\nCARD_KEYWORD_3=Dipendente\nCARD_KEYWORD_4=Esperienza guidata\nCARD_KEYWORD_5=Risorse umane\nLMS_DESTINATION=SAP SuccessFactors Learning\nSF_DESTINATION=SAP SuccessFactors HXM Suite\nWF_DESTINATION=SAP Workflow\n\n#This is the title of a card\nCARD_TITLE_LABEL=Titolo\nCARD_TITLE_DEFAULT_VALUE=Ritorno all\'ambiente di lavoro\n#This is the subtitle of a card\nCARD_SUBTITLE_LABEL=Sottotitolo\n\nDESC_TITLE=Informazioni sul ritorno all\'ambiente di lavoro\nDESC_INFORMATION=Utilizza questa esperienza guidata per completare il sondaggio precedente al ritorno, rivedere le linee guida dell\'ufficio e completare i corsi di formazione obbligatori prima di tornare all\'ambiente di lavoro.<br/><br/>\nDESC_INFORMATION_2=Per maggiori informazioni sull\'esperienza guidata, consultare la documentazione dell\'help.\nHELP_INFORMATION_TEXT=Vai a Help Portal\nHELP_INFORMATION_TITLE=Apri in una nuova scheda o finestra\n\nWIZARD_START_BTN_LABEL=Inizia ora\nWIZARD_SUBMIT_BTN_LABEL=Completa\n\nWORKFLOW_STATUS_SUCCESS_TITLE=Operazione riuscita!\nWORKFLOW_STATUS_SUCCESS_DESC=Hai concluso il processo di Ritorno all\'ambiente di lavoro. Bentornato/a al lavoro!\nQUALTRICS_ANONYMOUS_TITLE=Sondaggio (facoltativo)\n\nCOMPLETE_RETURN_SURVEY_STEP_TITLE=Completa sondaggio precedente al ritorno\nCOMPLETE_RETURN_SURVEY_STEP_DESCRIPTION=In questo passaggio, completa il sondaggio precedente al ritorno per consentire all\'azienda di comprendere la tua preparazione e organizzare le fasi di ritorno. Dopo il sondaggio, pianifica una riunione con il tuo manager per discutere degli argomenti rilevanti.\nCOMPLETE_RETURN_SURVEY_STEP_SURVEY_TITLE=Completa sondaggio\nCOMPLETE_RETURN_SURVEY_STEP_MEETING_TITLE=Pianifica riunione\nCOMPLETE_RETURN_SURVEY_STEP_MEETING_DESCRIPTION=Discuto con il manager dettagli quali data di ritorno, piani lavorativi aggiornati e orario di lavoro previsto nell\'ambiente di lavoro.\nCOMPLETE_RETURN_SURVEY_STEP_MEETING_CHECKLIST_LABEL=Organizza riunione con manager\n\nREVIEW_OFFICE_GUIDELINES_STEP_TITLE=Rivedi politiche e procedure\nREVIEW_OFFICE_GUIDELINES_STEP_DESCRIPTION=In questo passaggio, scopri le politiche e le procedure pi\\u00f9 recenti, comprese quelle per l\'utilizzo di ambienti e attrezzature dell\'ufficio.\n# For review office guidelines checkbox text\nREVIEW_OFFICE_GUIDELINES_STEP_GUIDELINES_TITLE=Rivedi linee guida dell\'ufficio\nREVIEW_OFFICE_GUIDELINES_GENERAL_OFFICE_GUIDELINES_CHECKBOX_TEXT=Linee guida dell\'ufficio generali\nREVIEW_OFFICE_GUIDELINES_CAFETERIA_GUIDELINES_CHECKBOX_TEXT=Linee guida della mensa\nREVIEW_OFFICE_GUIDELINES_CONFERENCE_ROOM_GUIDELINES_CHECKBOX_TEXT=Linee guida della sala riunioni\nREVIEW_OFFICE_GUIDELINES_DESK_ETIQUETTE_GUIDELINES_CHECKBOX_TEXT=Linee guida per etichetta alla scrivania\nREVIEW_OFFICE_GUIDELINES_PARKING_SPACE_GUIDELINES_CHECKBOX_TEXT=Linee guida per parcheggi\n# For sign mandatory forms checkbox text\nSIGN_MANDATORY_FORMS_TITLE=Firma moduli obbligatori\nREVIEW_OFFICE_GUIDELINES_ARRAGEMENT_FORM_CHECKBOX_TEXT=Modulo accordi per Ritorno all\'ambiente di lavoro\nREVIEW_OFFICE_GUIDELINES_HEALTH_SCREEN_FORM_CHECKBOX_TEXT=Modulo per screening sanitario del dipendente\n# For design time\nSTEP_PREFIX=Passaggio:\nCOMPLETE_RETURN_SURVEY_PARAM_LABEL_QUALTRICS_URL=URL progetto Qualtrics\nREVIEW_OFFICE_GUIDELINES_CHECKLIST_TITLE_LABEL=Lista di controllo linee guida dell\'ufficio\nSIGN_MANDATORY_FORMS_TITLE_LABEL=Lista di controllo moduli obbligatori\nCHECKLIST_ITEM_PREFIX=Voce della lista di controllo\nLAST_PAGE=Pagina finale\n\n# Labels for - Complete Vaccine Check\nENABLE_VACCINE_STEP_IN_DT=Attiva passaggio Invia stato vaccinale\nCOMPLETE_VACCINE_CHECK_TITLE=Invia stato vaccinale\nCOMPLETE_VACCINE_MDF_OBJECT=ID oggetto MDF vaccino\nCOMPLETE_VACCINE_CHECK_DESC=In questo passaggio, rivedi le linee guida aziendali per la vaccinazione contro la COVID-19 e aggiorna le tue informazioni vaccinali.\nREVIEW_VACCINE_GUIDANCE_TITLE=Rivedi linee guida vaccinali\nREVIEW_VACCINE_GUIDANCE_CHECKBOX_TEXT=Linee guida vaccinali aziendali\nUPDATE_VACCINE_STATUS_TITLE=Aggiorna informazioni vaccinali\nVACCINE_YET_LABEL=Hai gi\\u00e0 ricevuto il vaccino?\nVACCINE_STATUS_LABEL=Stato vaccinale\nFIRST_DOSE_DATE_LABEL=Data della prima dose\nSECOND_DOSE_DATE_LABEL=Data della seconda dose\nSECOND_DOSE_BEFORE_FISRT_DOSE_ERROR_MESSAGE=La data della seconda dose deve essere successiva alla data della prima dose.\nPICKLIST_COVIDYESNO_LABEL1=S\\u00cc\nPICKLIST_COVIDYESNO_LABEL2=NO\nPICKLIST_VACCINATIONSTATUS_LABEL1=Vaccino ricevuto (solo prima dose)\nPICKLIST_VACCINATIONSTATUS_LABEL2=Pianificato\nPICKLIST_VACCINATIONSTATUS_LABEL3=Vaccinato/a completamente\nPICKLIST_VACCINATIONSTATUS_LABEL4=Rifiutato\nREVIEW_VACCINE_GUIDANCE_CHECKBOX1=Casella di controllo 1\nMDFOBJECT_NOT_EXIST_WARNING_INFO=Si \\u00e8 verificato un errore di configurazione, contattare l\'amministratore. \\u00c8 comunque possibile procedere al passaggio successivo, ma non \\u00e8 possibile completare il processo fino a che non viene risolto l\'errore.\nMDFOBJECT_UPSERT_ERROR_MESSAGE=Impossibile aggiornare lo stato vaccinazione. Riprova o contatta l\'amministratore.\n\n# Labels for Step 3 - Complete Learning Courses\nCOMPLETE_LEARNING_COURSES_STEP_TITLE=Completa corsi di formazione\nCOMPLETE_LEARNING_COURSE_STEP_DESCRIPTION=In questo passaggio, completa i corsi di formazione obbligatori per il ritorno all\'ambiente di lavoro.\nCOMPLETE_LEARNING_COURSE_STEP_MANDATORY_COURSES=Corsi di formazione obbligatori\nCOMPLETE_LEARNING_COURSE_STEP_OPTIONAL_COURSES=Corsi di formazione facoltativi\nCOMPLETE_LEARNING_COURSE_STEP_CONFIG_TOOLTIP=Solo gli amministratori SAP SuccessFactors Learning possono configurare corsi di formazione. Se sei un amministratore di Learning e non riesci a configurare questo campo, contatta l\'amministratore di sistema.\n## {0} below is a due date for courses\nCOMPLETE_LEARNING_COURSE_STEP_DUE_DATE=Scadenza: {0}\nCOMPLETE_LEARNING_COURSE_STEP_OVERDUE=Scaduto\nCOMPLETE_LEARNING_COURSE_STEP_DUE_ANYTIME=Scadenza in qualsiasi momento\nLEARNING_COURSE_IMAGE_TOOLTIP=Immagine corso\nLEARNING_COURSE_AVERAGE_RATING_TOOLTIP=Valutazione del corso {0} stelle su 5\nLEARNING_COURSE_TOTAL_RATING_TOOLTIP=Valutatori totali: {0}\n\nLOAD_ERROR_TITLE=Impossibile caricare i dati\nLOAD_ERROR_DESC=Si \\u00e8 verificato un errore di rete. Riprovare pi\\u00f9 tardi o contattare l\'amministratore.\nAPI_ERROR_INFO=Si \\u00e8 verificato un errore a causa di problemi di rete. Riprovare pi\\u00f9 tardi.\n',
